export class Student{
    id: number;
    name: string;
    family: string;
    addres:string;
    phon:string;
    works:boolean;
    avg:number;
    dateLeave?:Date;
    constructor(name: string="",id:number, family: string,addres:string,phon:string,works:boolean,avg:number,dateLeave:Date)  {
        this.id = id;
        this.name = name;
        this.addres=addres;
        this.avg=avg;
        this.phon=phon;
        this.works=works;
        this.family=family;
        this.dateLeave=dateLeave;
    }
    
}
